BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "person" (
	"id"	INTEGER NOT NULL,
	"parentsID"	INTEGER,
	"surname"	TEXT,
	"forename"	TEXT,
	"maiden_surname"	TEXT,
	"maiden_forename"	TEXT,
	"gender"	TEXT,
	"birthPlace"	INTEGER,
	"deathPlace"	INTEGER,
	"birth_year"	INTEGER,
	"birth_month"	INTEGER,
	"birth_day"	INTEGER,
	"death_year"	INTEGER,
	"death_month"	INTEGER,
	"death_day"	INTEGER,
	"death_cause"	TEXT,
	"occupation"	TEXT,
	"notes"	TEXT,
	PRIMARY KEY("id")
);
COMMIT;
